import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import * as serviceWorker from './serviceWorker';
import 'tachyons';
import { dogs, cats } from './pets';

ReactDOM.render(
				<div>
					<Card img={dogs[0].img} name={dogs[0].name} description={dogs[0].description}/>
					<Card img={dogs[1].img} name={dogs[1].name} description={dogs[1].description}/>
					<Card img={dogs[2].img} name={dogs[2].name} description={dogs[2].description}/>
					<Card img={dogs[3].img} name={dogs[3].name} description={dogs[3].description}/>
					<Card img={cats[0].img} name={cats[0].name} description={cats[0].description}/>
					<Card img={cats[1].img} name={cats[1].name} description={cats[1].description}/>
				</div>
	,document.getElementById('root'));
serviceWorker.unregister();
